import java.math.BigInteger;


public class Testing_For_Time_Consumption {

	public static void main(String[] str) {
		Paillier key = new Paillier(64,16);
		BigInteger number = new BigInteger("1234567");
		long totalTimeStart = System.nanoTime();
		number = key.Encryption(number);
		long totalTimeEnd1 = System.nanoTime();
		System.out.println("computation time of encrypt 7 digit is "+((totalTimeEnd1-totalTimeStart)/1000000.0)+"ms");
		totalTimeStart = System.nanoTime();
		number = key.Encryption(new BigInteger(""));
		totalTimeEnd1 = System.nanoTime();
		
		System.out.println("computation time of encrypt thousands digit is "+((totalTimeEnd1-totalTimeStart)/1000000.0)+"ms");
		
		totalTimeStart = System.nanoTime();
		number = Utills.BigIntegerPow(number,new BigInteger("1234"));
		totalTimeEnd1 = System.nanoTime();
		System.out.println("computation time of pow ^ 4 is "+((totalTimeEnd1-totalTimeStart)/1000000.0)+"ms");
		totalTimeStart = System.nanoTime();
		number = Utills.BigIntegerPow(number,new BigInteger("12345"));
		totalTimeEnd1 = System.nanoTime();
		System.out.println("computation time of pow ^ 5 is "+((totalTimeEnd1-totalTimeStart)/1000000.0)+"ms");
		totalTimeStart = System.nanoTime();
		number = Utills.BigIntegerPow(number,new BigInteger("123456"));
		totalTimeEnd1 = System.nanoTime();
		System.out.println("computation time of pow ^ 6 is "+((totalTimeEnd1-totalTimeStart)/1000000.0)+"ms");
		totalTimeStart = System.nanoTime();
		number = Utills.BigIntegerPow(number,new BigInteger("1234567"));
		totalTimeEnd1 = System.nanoTime();
		System.out.println("computation time of pow ^ 7 is "+((totalTimeEnd1-totalTimeStart)/1000000.0)+"ms");
		
		
		
		
	}
}
